    public List<UserInfoMapper> transform(Collection<ResultBean> users) {
        List<UserInfoMapper> userList = new ArrayList<>();
        if (users != null) {
            for (NetUserInfosByPcsEntity.ResultBean userEntity : users) {
                UserInfoMapper user = transform(userEntity);
                if (user != null) {
                    userList.add(user);
                }
            }
        }
        return userList;
    }

    private String getPinYinFirst(String name) {
        String shortPinyin = null;
        try {
            if (StringUtils.isEmpty(name)) return "A";

            shortPinyin = PinyinHelper.getShortPinyin(name);
            if (StringUtils.isEmpty(shortPinyin)) shortPinyin = "A";

        } catch (Exception e) {
            e.printStackTrace();
            return "A";
        }
        return shortPinyin.substring(0, 1).toUpperCase();
    }

    private UserInfoMapper transform(NetUserInfosByPcsEntity.ResultBean userEntity) {
        UserInfoMapper user = null;
        if (userEntity != null) {
            user = new UserInfoMapper();
            user.setName(userEntity.getNAME());
            user.setCellphone(userEntity.getCELLPHONE());
            user.setFirstNamePinYin(getPinYinFirst(userEntity.getNAME()));
        }
        return user;
    }
